import React from "react";
import '../styles/dashboard.css'
import { Container , Row ,Col} from 'reactstrap';
import { AuthContext } from '../../context/AuthContext';



const Dashboard = () => {
const {user,dispatch} = useContext(AuthContext)

    return (
        <Container>
            <Row>
                <Col lg='6'>
                    <h3>User Details : </h3>
                    <h5>User Name : {}</h5>
                </Col>
            </Row>
        </Container>
    )
}

export default Dashboard;
